import React from "react";
import "../css/Menu.css";

function Menu() {
  return (
    <div className="menu">
      <div className="menu-card"></div>
      <div className="menu-card">Personality Test</div>
      <div className="menu-card"></div>
    </div>
  );
}

export default Menu;
